import React from 'react'
import { Thumbnail, Header2 } from './StyledElements'
import styled from 'styled-components'

const ProjectWrapper = styled.div`
    display: grid;

`

const ProjectsWrapper = styled.div`

`




export default function ({ projects }) {
    return (
        <ProjectsWrapper>

            {projects.map(project => (
                <ProjectWrapper>
                    <Header2>{project.title}</Header2>
                    {project.description}
                    <Thumbnail src={project.imageURL}/>
                </ProjectWrapper>
            ))}
        </ProjectsWrapper>
    )
}
